 /* This creates the Specialization Table 'Hospital' */
 -- @block
CREATE TABLE Hospital( 
    IKey INT NOT NULL AUTO_INCREMENT, 
    InOutPatient BOOLEAN,   
    ICU BOOLEAN, 
    Labs BOOLEAN, 
    EmergencyRoom BOOLEAN, 
    PRIMARY Key (IKey), 
    FOREIGN Key (IKey) References Institution (Ikey) 
); 

