NOTE  Clinics primary key will begin at 201 and end with 401

*/

/* This creates the Specialization Table 'Clinic' */
-- @block
CREATE TABLE Clinic( 
    IKey INT NOT NULL AUTO_INCREMENT, 
    Labs BOOLEAN, 
    UrgentCare BOOLEAN, 
    PRIMARY Key (IKey), 
    FOREIGN Key (IKey) References Institution (Ikey) 
); 

